listing.description:
Casa localizada na Rua Garcia Rodrigues, nº 1189 , bairro Jardim Industrial.
Referências: Ao lado da Escola Pedro de Alcântara e próximo ao Hospital Santa Rita.

Vantagens em alugar este imóvel:

* Boa Localização;
* Próximo a rua mais comercial do bairro;
* Imóvel Independente;
* Sol da manhã;
* Quintal enorme e excelente área externa;
* Barracão nos fundos;
* Água e Luz individual;

 Casa 01 disposta em: 03 (três) quartos, sala, copa, cozinha, banheiro, área de serviço, excelente quintal e garagem para 01 carro.
 Casa 02 disposta em: 01 (um) quarto, sala, cozinha, banheiro externo e área externa.
